import React from 'react';
import { Router } from '@reach/router';

import { Navbar, Button, Alignment, Classes, Colors } from '@blueprintjs/core';

const Container = ({ children }) => (
    <div className='container'>
        {children}
        
        <style jsx>{`
            .container {
                width: 100%;
                margin: 0 auto;
                max-width: 850px;
            }
        `}</style>
    </div>
);

const Home = () => (<>
    <div style={{ height: '100vh', backgroundColor: Colors.DARK_GRAY3 }} className={Classes.DARK}>
        <Navbar>
            <Container>
            <Navbar.Group align={Alignment.LEFT}>
                <Navbar.Heading>votsec</Navbar.Heading>
                <Navbar.Divider />
                
                <Button minimal text='lab' />
            </Navbar.Group>
            </Container>
        </Navbar>
    </div>
</>);

const Lab = () => (
    <p>
        This is the lab
    </p>
);

const App = () => (
    <Router>
        <Home path='/' />
        <Lab path='/lab' />
    </Router>
);

export default App;
